import React from 'react';
//import { Navbar,NavDropdown} from 'react-bootstrap';
//import { Container} from 'reactstrap';
//import { Form, Button,FormControl } from "react-bootstrap";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
// import 'bootstrap/dist/css/bootstrap.min.js'
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";
import { Navbar, Nav, Container } from 'react-bootstrap';



const Navigation = () => {
    return (
      <>
  <Navbar bg="dark" variant="dark">
    <Container>
    <Navbar.Brand href="#home">OceanNews</Navbar.Brand>
    <Nav className="me-auto">
      <Nav.Link href="#home">Home</Nav.Link>
      <Nav.Link href="#features">AllNews</Nav.Link>
      <Nav.Link href="#pricing">India</Nav.Link>
      <Nav.Link href="#features">Business</Nav.Link>
      <Nav.Link href="#pricing">Sports</Nav.Link>
      <Nav.Link href="#features">World</Nav.Link>
      <Nav.Link href="#pricing">Politics</Nav.Link>
      <Nav.Link href="#features">Technology</Nav.Link>
      <Nav.Link href="#pricing">Startup</Nav.Link>
      <Nav.Link href="#features">Technology</Nav.Link>
      <Nav.Link href="#pricing">Startup</Nav.Link>

    </Nav>
    </Container>
  </Navbar>
  <br />

</>
    )
}

export default Navigation
